import React from "react";
import Card from "react-bootstrap/Card";

const Latest = (props) => {
  return (
    <div>
      <Card>
        <Card.img src={"https://image.tmdb.org/t/p/w185/" + props.img} alt="" />
      </Card>
    </div>
  );
};

export default Latest;
